sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
if (inputs.status_code == '200'){
var responseObject = JSON.parse(inputs.response_body);
outputs.street_address = responseObject.address.streetAddress;
outputs.city = responseObject.address.city;
outputs.state = responseObject.address.state;
outputs.zipcode = responseObject.address.ZIPCode;
outputs.zipplus4 = responseObject.address.ZIPPlus4;
}
})(inputs, outputs);

